    <style>
        :root {
            --primary: #2563eb;
            --bg: #f8fafc;
            --card-bg: #ffffff;
            --text: #1e293b;
            --shadow: 0 4px 6px -1px rgba(0, 0, 0, 0.1), 0 2px 4px -1px rgba(0, 0, 0, 0.06);
            --shadow-hover: 0 20px 25px -5px rgba(0, 0, 0, 0.1), 0 10px 10px -5px rgba(0, 0, 0, 0.04);
        }

        body {
            font-family: 'Inter', sans-serif;
            background-color: var(--bg);
            color: var(--text);
            margin: 0;
            padding: 0;
            overflow-y: scroll;
        }

        /* HERO HEADER */
        .hero {
            background: linear-gradient(135deg, #1e3a8a 0%, #3b82f6 100%);
            color: white;
            padding: 60px 20px 80px;
            text-align: center;
            border-bottom-left-radius: 30px;
            border-bottom-right-radius: 30px;
            box-shadow: 0 10px 30px rgba(37, 99, 235, 0.2);
            position: relative;
            z-index: 10;
        }

        .hero h1 { margin: 0; font-size: 2.5rem; font-weight: 800; letter-spacing: -1px; }
        .hero p { opacity: 0.9; margin-top: 10px; font-size: 1.1rem; }

        /* SEARCH BAR (Floating) */
        .search-container {
            margin-top: -30px;
            display: flex;
            justify-content: center;
            padding: 0 20px;
        }
        
        .search-box {
            background: white;
            width: 100%;
            max-width: 600px;
            padding: 18px 25px;
            border-radius: 50px;
            border: none;
            box-shadow: 0 10px 25px rgba(0,0,0,0.1);
            font-size: 18px;
            font-family: inherit;
            transition: all 0.3s ease;
            outline: none;
        }
        
        .search-box:focus { transform: scale(1.02); box-shadow: 0 15px 30px rgba(37, 99, 235, 0.2); }

        /* GRID LAYOUT */
        .container { max-width: 1200px; margin: 40px auto; padding: 0 20px; }
        .stats { text-align: center; color: #64748b; margin-bottom: 20px; font-size: 0.9rem; }

        .book-grid {
            display: grid;
            grid-template-columns: repeat(auto-fill, minmax(160px, 1fr));
            gap: 25px;
        }

        /* CARD DESIGN */
        .book-card {
            background: var(--card-bg);
            border-radius: 16px;
            overflow: hidden;
            box-shadow: var(--shadow);
            transition: all 0.3s cubic-bezier(0.4, 0, 0.2, 1);
            position: relative;
            display: flex;
            flex-direction: column;
            animation: fadeIn 0.5s ease-out forwards;
            opacity: 0; /* Hidden initially for animation */
        }

        @keyframes fadeIn { from { opacity: 0; transform: translateY(20px); } to { opacity: 1; transform: translateY(0); } }

        .book-card:hover {
            transform: translateY(-8px);
            box-shadow: var(--shadow-hover);
        }

        .img-wrapper {
            position: relative;
            padding-top: 140%; /* 5:7 Aspect Ratio */
            background: #e2e8f0;
            overflow: hidden;
        }

        .img-wrapper img {
            position: absolute;
            top: 0; left: 0;
            width: 100%; height: 100%;
            object-fit: cover;
            transition: transform 0.5s ease;
        }

        .book-card:hover .img-wrapper img { transform: scale(1.05); }

        .card-content { padding: 15px; flex-grow: 1; display: flex; flex-direction: column; justify-content: space-between; }
        
        .book-title {
            font-size: 0.95rem;
            font-weight: 600;
            color: var(--text);
            margin: 0 0 10px 0;
            display: -webkit-box;
            -webkit-line-clamp: 2;
            -webkit-box-orient: vertical;
            overflow: hidden;
            line-height: 1.4;
        }

        .download-btn {
            display: block;
            width: 100%;
            padding: 10px 0;
            text-align: center;
            background: #eff6ff;
            color: var(--primary);
            font-weight: 600;
            font-size: 0.85rem;
            border-radius: 8px;
            text-decoration: none;
            transition: background 0.2s;
        }

        .download-btn:hover { background: var(--primary); color: white; }
        
        /* LOADING SPINNER */
        .loader { text-align: center; padding: 40px; display: none; }
        .spinner { border: 4px solid #f3f3f3; border-top: 4px solid var(--primary); border-radius: 50%; width: 30px; height: 30px; animation: spin 1s linear infinite; display: inline-block; }
        @keyframes spin { 0% { transform: rotate(0deg); } 100% { transform: rotate(360deg); } }

    </style>
</head>

f\u09a6\u09be\u09a4\u09c1\u09a4 \u09a4\u09b9\u09be\u09ad\u09c0 02 .mp4", "link": "https://t.me/SobBoiErPdf/23184", "img": "images/23184.jpg"}, {"title": "001 \u09a4\u09be\u0993\u09b9\u09c0\u09a6\u09c7\u09b0 \u09aa\u09cd\u09b0\u0995\u09c3\u09a4 \u09aa\u09b0\u09bf\u099a\u09df .mp4", "link": "https://t.me/SobBoiErPdf/23183", "img": "images/23183.jpg"}, {"title": "000 \u0986\u0995\u09bf\u09a6\u09be\u09a4\u09c1\u09a4 \u09a4\u09be\u09b9\u09be\u09ad\u09c0 \u09aa\u09b0\u09bf\u099a\u09bf\u09a4\u09bf 01.mp4", "link": "https://t.me/SobBoiErPdf/23182", "img": "images/23182.jpg"}, {"title": "\u09ee\u09ea \u09b8\u09be\u0987\u09af\u09bc\u09c7\u09a6\u09c1\u09b2 \u09ae\u09cb\u09b0\u09b8\u09be\u09b2\u09c0\u09a8 \u09aa\u09cd\u09b0\u09a5\u09ae \u0996\u09a8\u09cd\u09a1", "link": "https://t.me/SobBoiErPdf/3565", "img": "images/3565.jpg"}, {"title": "\u09ee\u09eb \u09b8\u09be\u0987\u09af\u09bc\u09c7\u09a6\u09c1\u09b2 \u09ae\u09c1\u09b0\u09b8\u09be\u09b2\u09c0\u09a8 \u09b9\u09cb \u0985\u09cd\u09af\u09be \u09a6\u09cd\u09ac\u09bf\u09a4\u09c0\u09af\u09bc \u0996\u09a8\u09cd\u09a1", "link": "https://t.me/SobBoiErPdf/3564", "img": "images/3564.jpg"}, {"title": "\u09ee\u09ec \u09b8\u09be\u0987\u09af\u09bc\u09c7\u09a6\u09c1\u09b2 \u09ae\u09c1\u09b0\u09b8\u09be\u09b2\u09c0\u09a8 \u09a4\u09c3\u09a4\u09c0\u09af\u09bc \u0996\u09a8\u09cd\u09a1", "link": "https://t.me/SobBoiErPdf/3563", "img": "images/3563.jpg"}]; 
        
        const grid = document.getElementById('grid');
        const loader = document.getElementById('loader');
        const searchInput = document.getElementById('searchInput');
        const statsText = document.getElementById('statsText');
        
        let visibleCount = 0;
        const BATCH_SIZE = 40; // Render 40 at a time for speed
        let filteredDB = DB; // Initially, filtered list is the full list

        // 1. Initialize
        function init() {
            statsText.innerText = `${DB.length.toLocaleString()} books available`;
            renderNextBatch();
        }

        // 2. Render Card Function
        function createCard(book) {
            const div = document.createElement('div');
            div.className = 'book-card';
            // Use placeholder if img is missing/broken, but rely on lazy loading
            const imgUrl = book.img && book.img.length > 5 ? book.img : 'https://via.placeholder.com/200x300?text=PDF';
            
            div.innerHTML = `
                <div class="img-wrapper">
                    <img src="${imgUrl}" loading="lazy" alt="Cover">
                </div>
                <div class="card-content">
                    <div class="book-title">${book.title}</div>
                    <a href="${book.link}" target="_blank" class="download-btn">Download</a>
                </div>
            `;
            return div;
        }

        // 3. Render Batch (Infinite Scroll Logic)
        function renderNextBatch() {
            const fragment = document.createDocumentFragment();
            const end = Math.min(visibleCount + BATCH_SIZE, filteredDB.length);
            
            for (let i = visibleCount; i < end; i++) {
                fragment.appendChild(createCard(filteredDB[i]));
            }
            
            grid.appendChild(fragment);
            visibleCount = end;
            
            // Hide loader if we showed everything
            if (visibleCount >= filteredDB.length) {
                loader.style.display = 'none';
            }
        }

        // 4. Search Function (Debounced)
        let timeout = null;
        searchInput.addEventListener('input', (e) => {
            clearTimeout(timeout);
            timeout = setTimeout(() => {
                const q = e.target.value.toLowerCase();
                
                // Filter the array
                filteredDB = DB.filter(b => b.title.toLowerCase().includes(q));
                
                // Reset Grid
                grid.innerHTML = '';
                visibleCount = 0;
                statsText.innerText = `Found ${filteredDB.length} books`;
                
                // Render first batch of results
                renderNextBatch();
            }, 300);
        });

        // 5. Infinite Scroll Event
        window.addEventListener('scroll', () => {
            if ((window.innerHeight + window.scrollY) >= document.body.offsetHeight - 500) {
                if (visibleCount < filteredDB.length) {
                    renderNextBatch();
                }
            }
        });

        // Start
        init();
    </script>
